import React from "react";
import styled from "styled-components";
const Logo = require("../../../assents/logo.png");

const NavBar: React.FC = () => {
  return (
    <NavBarWrapper>
      <div className="gz_navbar-links">
        <div className="gz_navbar-logo">
          <img src={Logo} alt="" />
        </div>
        <div className="gz_navbar-links_container">
          <p>
            <a href="#gh">Home</a>
          </p>
          <p>
            <a href="#askxajkshd">What is Geeky-Zindagi?</a>
          </p>
          <p>
            <a href="#asnkd">Community</a>
          </p>
        </div>
        <div className="gz_navbar-sign">
          <p>Sign In</p>
          <button type="button" ></button>
        </div>
      </div>
    </NavBarWrapper>
  );
};

export default NavBar;

const NavBarWrapper = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;

  padding: 1rem 2rem;

  .gz_navbar-links {
    display: flex;
    justify-content: flex-start;
    align-items: center;

    .gz_navbar-logo {
      margin-right: 2rem;
      img {
        width: 12rem;
        height: 3rem;
      }
    }
    .gz_navbar-links_container {
      display: flex;
      flex-direction: row;

      p {
        margin: 0 1rem;
        cursor: pointer;
        a {
          color: #fff;
          font-family: var(--font-family);
          font-weight: 500;
          line-height: 2rem;
          text-decoration: none;
          text-transform: capitalize;
        }
      }
    }
  }
`;
